export function Header(){
    return (
        <div>
            <SubHeader />
            <HeaderImg />
        </div>
    )
}

function SubHeader(){
    return (
        <div>
            <Form />
            <Title />
        </div>
    )
}

function Form(){
    return (
        <form>    
            <input type="text" name="" placeholder="Enter Search Term (e.g iPhone x, 128GB or A1 " />
            <input type="submit" value="SEARCH" />
        </form>
    )
}

function Title(){
    return (
        <div>
            <h1>SHOP OUR LATEST AVAILABLE STOCK HERE</h1>
        </div>
    )
}

function HeaderImg(){
    return (
        <div>
            <img src="" alt="accessories" width="500" height="600" />
        </div>
    )
}
